import { Link } from 'react-router-dom';
import { Helmet } from 'react-helmet'

const BlogList = ({ blogs }) => {
    const handleScroll = () => {
        console.log('scolled')
    }
    return (
		<div className="blog-list" onScroll={handleScroll}>
			<Helmet>
				<meta charset="utf-8" />
				<title>Mini Blog</title>
			</Helmet>
			{blogs.map((blog) => (
				<div key={blog.id}>
					<Link to={`/blog/${blog.id}`}>
						<img className="list-img" src={blog.image} alt="" />
					</Link>
					<div className="blog-preview">
						<div className="blogs">
							<Link to={`/blog/${blog.id}`}>
								<h2>{blog.title}</h2>
								<p>{blog.author}</p>
							</Link>
						</div>
					</div>
				</div>
			))}
		</div>
	);
}

export default BlogList;
